import React from 'react';

const Nav = ({ triggerAboutMe, triggerEducation, triggerWork }) => {
    return (
        <nav id='nav-bar' className='flex justify-end'>
            <p onClick={() => triggerAboutMe()} className='f3 dim link white underline pa3 pointer'>About Me</p>
            <p onClick={() => triggerEducation()} className='f3 dim link white underline pa3 pointer'>Education</p>
            <p onClick={() => triggerWork()} className='f3 dim link white underline pa3 pointer'>Work</p>
        </nav>
    )
}

export default Nav;
